// src/App.js

import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import LandingPage from './components/LandingPage'; // Your landing page component
// Import Login and Signup pages if you create them later
// import LoginPage from './components/LoginPage';
// import SignupPage from './components/SignupPage';

function App() {
  return (
    <Router>
      <div className="App">
        {/* Define your routes */}
        <Switch>
          {/* Landing page route */}
          <Route exact path="/" component={LandingPage} />

          {/* Login page route (create LoginPage.js if you want) */}
          {/* <Route path="/login" component={LoginPage} /> */}

          {/* Signup page route (create SignupPage.js if you want) */}
          {/* <Route path="/signup" component={SignupPage} /> */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
